  \"2016-07-27T22:45:53.477264\",\n\t\"name\": \"narrative-report-fish-springs-national-wildlife-refuge-dugway-ut-for-the-period-may-june-1-598e8\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Fish Springs
  National Wildlife Refuge outlines Refuge accomplishments from May through August
  of 1963. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover during this period. Wildlife- including migratory
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, fish,
  reptiles, and disease- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, collections and receipts, and vegetation
  control. Resource management is outlined; topics include peat mining, and frog farming.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  and safety. Items of interest, N-R forms, and photographs are attached.\",\n\t\"license_title\":
